import "./AboutUsForm.css"
function AboutUsForm(props){
    return(
        <center className="aboutUs-form">
            <h1>Gabriel Terrazas</h1>
            <h1>Emilia Rivas</h1>
            <h1>Diego Acosta</h1>
            <button onClick={props.onCancel}>Close</button>
        </center>
    )
}

export default AboutUsForm
